import "./App.css";
import Clock from "./Clock";
import { NameForm, EssayForm, FlavorForm, ReservationForm } from "./Forms";

function App() {
  return (
    <div className='App'>
      <Clock />
      <NameForm />
      <EssayForm />
      <FlavorForm />
      <ReservationForm />
    </div>
  );
}

export default App;
